import Navigation from './components/navigation';
import {BrowserRouter as Router, Routes, Route, Redirect} from 'react-router-dom';

const navLinks = [
  {
      title: 'Home',
      path: '/'
  },
  {
      title: 'Blog',
      path: '/blog'
  },
  {
      title:'Contact',
      path:'/contact'
  },
  {
      title:'Shop',
      path:'/shop'
  },
  {
      title:'Login',
      path:'/login'
  },
  {   title:'Create',
      path: '/create'
  }

]

const router = createBrowserRouter(
  navLinks.map((link) => ({
    path: link.path,
    element: <div>{link.title}</div>,
  }))
);

function App() {
  return (


    <Router>
      <div className="App">
        <Navigation />
        <Routes>

        </Routes>
      </div>
    </Router>
  );
}


export default App;
